commits.sourceNew:
/**
 * Subclasses must implement this method and should compute
 * a hashCode similar to this:
 * <pre>
 *   public int hashCode() {
 *     int code = startOffset;
 *     code = code * 31 + endOffset;
 *     return code;
 *   }
 * </pre> 
 * 
 * see also {@link #equals(Object)}
 */
@Override
public abstract int hashCode();

